 Requirements:
 - All from "log2".
 Caveats:
 - All from "log2".
 @param x The unsigned 60.18-decimal fixed-point number for which to calculate the common logarithm.
 @return result The common logarithm as an unsigned 60.18-decimal fixed-point number.

